import react from "react";
import "./header.css";
const Header = () => {
  return (
    <header className="container">
      <div className="header">
        <div className="logo">
          <img src="/images/Logo-header.svg" alt="Logo" /></div>
      </div>
    </header>
  );
};

export default Header;
